  constructor() {
    super();
    this.innerHTML = `${gridplaces}`;

    // htmlInner = `<div> aaa </div>`;
    // this.attachShadow({ mode: "open" });
    // this.shadowRoot.appendChild(template.content.cloneNode(true));
  }
  connectedCallback() {
    var typePlayer = "X";
    let i = 0;

    gridplaces = bord.map(() => {
      (i, typePlayer) => {
        return <Place name={i} player={typePlayer} />;
      };
      i++;
    });
  }

